import React from "react";

//display icon if user is not on the home page
let style =
  props.location.pathname !== "/"
    ? {
        display: "none"
      }
    : {
        height: "70px"
      };

function separator() {
  return (
    <div style={style}>
      <p>dsada</p>
    </div>
  );
}

export default separator;
